import React from 'react';
import styled from 'styled-components'

const Main = props => {
    return (
        <HEADER>
            <h1>Main Menu</h1>
            <h2>fury <span>(#</span>1042<span>)</span></h2>
            <p><span>Ranked</span> 7</p>
            <p><span>Yo pimp ass is worth</span> $1,967,781,500</p>
            <p>"HELL HATH NO"</p>
        </HEADER>
    )
}

export default Main

const HEADER = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;

    h1 {
        font-family: 'Lobster', arial, serif;
        font-size: 2.4rem;
    }
    h2 {
        font-size: 1.8rem;
        span {
            color: #9933ff
        }
    }
    p {
        font-size: 1.3rem;
        span {
            color: #9933ff
        }
    }
`
